Este poema pertenece al poeta navarro Francisco Javier Irazoki, nacido en 1954 en Lesaka (Navarra). El poema hace referencia al también escritor navarro Miguel Sánchez-Ostiz y al Portal de Francia, una ubicación en Pamplona.
